function rightSidebarJSON(i){$("#rightSidebar .fd-panel__title").append(i.title),$("#rightSidebar .fd-panel__description").append(i.description),$("#rightSidebar .fd-panel__footer").append(i.items.length+" items loaded successfully."),$(i.items).each(function(){var i;i='<li class="fd-list__item">',i+='   <span class="fd-list__title">'+this.header+"</span>",i+="</li>",$(i).appendTo("#rightSidebar .fd-list")})}function getRightSidebarData(i){$.ajax({dataType:"json",url:i+"/src/json/rightSidebar.min.json",success:rightSidebarJSON,error:function(){console.log("No right sidebar JSON found.")},complete:function(){console.log("Right sidebar JSON loaded.")}})}